import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import CssBaseline from '@material-ui/core/CssBaseline';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import TableChartIcon from '@material-ui/icons/TableChart';
import TimelineIcon from '@material-ui/icons/Timeline';
import FavoriteIcon from '@material-ui/icons/Favorite';
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography';

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  appBar: {
    width: `calc(100% - ${drawerWidth}px)`,
    marginLeft: drawerWidth,
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
    textAlign: 'center',
  },
  drawerPaper: {
    width: drawerWidth,
    background: 'linear-gradient(#735751, #bf4342)',
  },
  // necessary for content to be below app bar
  toolbar: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    padding: theme.spacing(3),
  },
  avatar: {

      width: '75px',
      height: '75px',
      marginTop: '25px',
      marginBottom: '25px',
      fontSize: '25px',
      alignSelf: 'center'
  },
  listLabel: {
    color: 'white',
    fontFamily: '-apple-system-body, BlinkMacSystemFont, sans-serif',
    fontWeight: '300',
  },
  header: {
    color: 'white',
    fontWeight: '200',
    fontSize: '32px'
  }
}));

export default function PermanentDrawerLeft() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <CssBaseline />
      <Drawer
        className={classes.drawer}
        variant="permanent"
        classes={{
          paper: classes.drawerPaper,
        }}
        anchor="left"
      >
        <div className={classes.toolbar} />
        <Typography classes={classes.header}>Welcome to iHeartRate!</Typography>
        <Avatar className={classes.avatar} alt="Bryce Schmisseur" src="#">BS</Avatar>
        <Divider style={{backgroundColor: 'white', width: '90%', alignSelf: 'center'}}/>
        <List>
            <ListItem>
                <ListItemIcon className={classes.listLabel}><TableChartIcon /></ListItemIcon>
                <ListItemText><Typography className={classes.listLabel}>Table</Typography></ListItemText>
            </ListItem>
            <ListItem>
                <ListItemIcon className={classes.listLabel}><TimelineIcon /></ListItemIcon>
                <ListItemText><Typography className={classes.listLabel}>Chart</Typography></ListItemText>
            </ListItem>
            <ListItem>
                <ListItemIcon className={classes.listLabel}><FavoriteIcon /></ListItemIcon>
                <ListItemText><Typography className={classes.listLabel}>Live</Typography></ListItemText>
            </ListItem>
        </List>
      </Drawer>
    </div>
  );
}
